    draw(ctx, scale = ctx.canvas.width / this.width) {
      this.tiles.forEach((value, index) => {
        const dx = index % this.width;
        const dy = Math.floor(index / this.width);

        const tile = Tile[value];

        tile.draw(ctx, dx * scale, dy * scale, scale, scale);
      });
    }

